import React, {  useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function AddWilling(props) {
const [name, setName] = useState("")
const [location, setLocation] = useState("")
const [tiWilling , setTiWillin] = useState("")

const navigate = useNavigate()

const addBtn = () => {
    if(name.length > 20) {
        console.log("bad")
        alert("no more 20 charts")
    } else if(tiWilling.length > 200) {
        console.log("bad1")
        alert("no more 200 charts")
    } else if (location == "a-z" || location == "A-Z") {
        alert("jast char in inglish")
    } else {
        props.saveWillingDetails(name,location,tiWilling)
        navigate('/')
    }

}






  return (
    <div>
        <input type="text" onChange={(e)=>{setName(e.target.value)}} placeholder={"name"} /> <br />
        <input type="text" onChange={(e)=>{setLocation(e.target.value)}} placeholder={"location"} /> <br />
        <input type="text" onChange={(e)=>{setTiWillin(e.target.value)}} placeholder={"title-willing"} /> <br />
        <button className='largeBtn' onClick={addBtn}>add</button>
    </div>
  )
}
